import{_ as a,a as r,J as t,o as s}from"./chunks/framework.BWf-PbcG.js";const l="/assets/19367730_126796654572748_6357688621952139264_n.DpUtXwpP.jpg",n="/assets/22858127_141287923267269_2460889069446496256_n.Cs3NF5O3.jpg",o="/assets/26157281_139000163437001_7283924544404848640_n.C8FEXvLM.jpg",c="/assets/18121107_802382353254131_1686034606898319436_o-small.CdvsI_5b.jpg",i="/assets/tele-robot.mBkGCVXW.jpeg",p="/assets/tolik_mask.B2dgP2a4.jpg",h="/assets/AInoZPuO0I0.ChA9PE0d.jpg",k="/assets/BQBweH-nbU4.rlTJWLuv.jpg",m="/assets/654766200e41ad7d6ef2405830c6596c.3-yGQCUQ.jpeg",_="/assets/6004076c432487838ed8a191f69ceff0.LA-6bW32.jpeg",j=JSON.parse('{"title":"Минский хакерспейс","description":"Мастерская-клуб","frontmatter":{"title":"Минский хакерспейс","description":"Мастерская-клуб","date":"2018-08-30","icon":"4TWzXIjpsdg.jpg","cover":"cover.jpg","url":"https://hackerspace.by","telegram":"Hackerspace@Minsk","instagram":"byhackerspace","vk":"hackerspace_minsk","facebook":"hs.minsk","address":"ул. Алибегова, 24, пом. 153","city":"г. Минск","place":"Юго-Запад","tel":"+375 29 8 647 647","email":"info@hackerspace.by","youtube":"https://youtu.be/FOig7xGjfsQ","youtube-channel":"UCoRCmZJBL-zV3-U5e6iB2gQ","status":"open","coord":[53.87311779318168,27.478048442986015]},"headers":[],"relativePath":"workshop/catalog/hackerspace-minsk/index.md","filePath":"workshop/catalog/hackerspace-minsk/index.md"}'),g={name:"workshop/catalog/hackerspace-minsk/index.md"};function f(d,e,b,u,x,y){return s(),r("div",null,e[0]||(e[0]=[t('<h2 id="что-это-такое-мастерская" tabindex="-1">Что это такое? Мастерская. <a class="header-anchor" href="#что-это-такое-мастерская" aria-label="Permalink to &quot;Что это такое? Мастерская.&quot;">​</a></h2><p>Хакерспейс (hackerspace) — мастерская-клуб, где энтузиасты могут заниматься любимым делом, будь то радиолюбительство, конструирование, программирование, моделирование или даже художественное творчество. В мире существует <a href="https://hackerspaces.org/" class="external-link" target="_blank" rel="noreferrer">множество</a> хакерспейсов различной направленности, но, прежде всего, это — клубы технического творчества.</p><p><img src="'+l+'" alt=""><img src="'+n+'" alt=""><img src="'+o+'" alt=""><img src="'+c+'" alt=""><img src="'+i+'" alt=""><img src="'+p+'" alt=""></p><h2 id="чем-мы-здесь-занимаемся-мы-творим" tabindex="-1">Чем мы здесь занимаемся? Мы творим. <a class="header-anchor" href="#чем-мы-здесь-занимаемся-мы-творим" aria-label="Permalink to &quot;Чем мы здесь занимаемся? Мы творим.&quot;">​</a></h2><p>Мы паяем, программируем, вырезаем из металла, пластика и дерева. Мы делаем роботов, дронов и строим станки ЧПУ. Мы собираем 3D-принтеры. Мы делаем печатные платы. Мы делимся опытом и совершаем ошибки. Придумываем новые <a href="https://hackerspace.by/projects" class="external-link" target="_blank" rel="noreferrer">проекты</a> и улучшаем старые.</p><h2 id="как-к-нам-присоединиться-сколько-это-стоит" tabindex="-1">Как к нам присоединиться? Сколько это стоит? <a class="header-anchor" href="#как-к-нам-присоединиться-сколько-это-стоит" aria-label="Permalink to &quot;Как к нам присоединиться? Сколько это стоит?&quot;">​</a></h2><p>Мы не оказываем услуг, мы не магазин. Мы — сообщество людей, объединённых общими интересами. Поэтому, чтобы попасть к нам, надо хотеть (а лучше и уметь) что-либо создавать своими руками. Разовые посещения — свободные (время согласовывайте).</p><p>Если же вы <a href="https://hackerspace.by/procedure" class="external-link" target="_blank" rel="noreferrer">хотите</a> стать частью сообщества: творить вместе с нами на постоянной основе, иметь свой ключ и пользоваться нашими печеньками (а также помочь в оплате аренды, коммунальных услуг, покупке расходников и новых классных инструментов), то мы попросим вас финансово поучаствовать в общем деле. В основном, участники вносят 50 рублей в месяц, студенты – 20, но есть и другие <a href="https://hackerspace.by/tariffs" class="external-link" target="_blank" rel="noreferrer">тарифы</a>.</p><p>Вы также можете помочь проекту, написав о нем в своем блоге, сайте или просто оставив ссылку на стене в соцсети. Если у вас есть что-то, чем вы можете поделиться — запасы расходников, инструменты или просто знания — мы будем вам очень благодарны.</p><p><img src="'+h+'" alt=""><img src="'+k+'" alt=""></p><h2 id="что-у-нас-есть-всякое" tabindex="-1">Что у нас есть? Всякое. <a class="header-anchor" href="#что-у-нас-есть-всякое" aria-label="Permalink to &quot;Что у нас есть? Всякое.&quot;">​</a></h2><p>Прежде всего, у нас есть прекрасный обжитой подвальчик на 50 квадратных метров для тихой работы с отдельным входом, прекрасной шумоизоляцией, санузлом и круглосуточным доступом. У нас есть дополнительно около 300 квадратных метров площади для творчества и экспериментов. У нас есть всё, что нужно, для создания новых проектов — паяльные станции, цифровой осциллограф, логический анализатор, 3D-принтер, ЧПУ фрезер, токарный и шлифовальный станки, лазерный резак, есть набор электрического и ручного инструмента, запас радиокомпонентов, двигателей и материалов. Если чего-то вдруг не хватит, прямо над нами есть магазин радиодеталей &quot;Белчип&quot;. А ещё у нас есть люди, у которых всегда можно попросить совета и помощи.</p><p><img src="'+m+'" alt=""><img src="'+_+'" alt=""></p><h2 id="как-нас-наити-приходите" tabindex="-1">Как нас найти? Приходите. <a class="header-anchor" href="#как-нас-наити-приходите" aria-label="Permalink to &quot;Как нас найти? Приходите.&quot;">​</a></h2><p>Мы находимся по адресу: ул. Беды, 45 (<a href="https://www.mapillary.com/catalog/im/98iGzWktd9tuLs-agQWy2w/photo" class="external-link" target="_blank" rel="noreferrer">карта</a>). Вход со двора. Наш подвальчик – слева от третьего подъезда и салона &quot;Slim&quot;. Важно! У нас нет вахтёра, а, значит, попасть к нам можно только вместе с кем-нибудь или в день открытых дверей. Поэтому, прежде чем приходить в первый раз, уточните время в <a href="https://hackerspace.by/calendar" class="external-link" target="_blank" rel="noreferrer">календаре</a>, <a href="https://groups.google.com/d/forum/hackerspace-minsk" class="external-link" target="_blank" rel="noreferrer">рассылке</a>, группе <a href="https://www.facebook.com/hs.minsk" class="external-link" target="_blank" rel="noreferrer">Facebook</a>, <a href="https://vk.com/hackerspace_minsk" class="external-link" target="_blank" rel="noreferrer">Вконтакте</a> или в чате <a href="https://telegram.me/joinchat/Bxa3CT7ai59igvC1dP95Aw" class="external-link" target="_blank" rel="noreferrer">Telegram</a>.</p><p>И не забудьте почитать <a href="/theory/research/minsk-rules/">правила</a>.</p><p><a href="https://tech.onliner.by/2018/11/19/hackerspace" class="external-link" target="_blank" rel="noreferrer">Статья про хакерспейс на onliner.by</a><a href="https://www.the-village.me/village/city/mechanism/262585-we-are-not-hackers" class="external-link" target="_blank" rel="noreferrer">Статья на The Village</a><a href="https://devby.io/news/hackerspace-stop" class="external-link" target="_blank" rel="noreferrer">Хакерспейс в борьбе с Ковид-19</a></p>',17)]))}const q=a(g,[["render",f]]);export{j as __pageData,q as default};
